import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Import Pages
import Index from './pages/home'
import Support from './pages/support'
import Faq from './pages/faq'

export default function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path='/' element={<Index/>} errorElement={<Index/>} />
          <Route exact path='/soporte' element={<Support/>} errorElement={<Index/>} />
          <Route exact path='/preguntas-frecuentes' element={<Faq/>} errorElement={<Index/>} />
        </Routes>
      </Router>
    </div>
  );
}
